window.bookSummaryJSON = "<p><b>This title will be streaming in Audible Plus through September 1st, 2021. </b></p> <p>Emriss Silentborn, Memory of the World.&nbsp;</p> <p>Tiberian Arelius, the fallen Patriarch.&nbsp;</p> <p>Akura Malice, Queen of Shadows.&nbsp;</p> <p>Seshethkunaaz, King of Dragons.&nbsp;</p> <p>Reigan Shen, Emperor of Lions.&nbsp;</p> <p>Luminous Queen Sha Miara.&nbsp;</p> <p>The Eight-Man Empire.&nbsp;</p> <p>Northstrider.&nbsp;</p> <p>The Monarchs, the most powerful sacred artists on Cradle, rule with unquestioned authority. They are mysterious and distant, and catching a glimpse of one is privilege enough for a lifetime. To meet one is to come face-to-face with a legend.&nbsp;</p> <p>Now, they have all gathered in one place, bringing their heirs and greatest students together for a competition to determine whose successor is the best in the world:&nbsp;</p> <p>The Uncrowned King tournament.</p>"; 
